import Slider from '@material-ui/core/Slider'
import ButtonGroup from '@material-ui/core/ButtonGroup';
import Button from '@material-ui/core/Button'
import { styled } from '@material-ui/core/styles';

const MyButton = styled(Button)({
    color: 'white',
    borderColor: 'white',
})

const myButtonGroup = styled(ButtonGroup)({
    borderColor: 'white',
})


const Form = () => {
    return (
        <div className = "form">
            <h2>Focus
                <ButtonGroup color="white" aria-label="outlined primary button group" >
                <MyButton style={{ borderColor:"white", color: "#90caf9"}}> Upper Body </MyButton>
                <MyButton style={{borderColor:"white", color:"white"}}>Cardio</MyButton>
                <MyButton style={{borderColor:"white", color: "white"}}>Legs/Glutes</MyButton>
            </ButtonGroup>
            </h2>
            <h2>Level <Slider style={{width: "120px", marginLeft:"10px"}}
            ></Slider></h2>

            <h2>Time commitment <Slider style={{width: "120px", marginLeft:"10px", marginTop:"10px"}}
            ></Slider></h2>


            <button className = "challengebutton"> CHALLENGE MODE!</button>
            <button className = "challengebutton"> Let's Go!</button>
        </div>
      );
}

export default Form;
